import './Home.css'
import ListOfPolicies from '../ListOfPolicies/ListOfPolicies'
import React, { useState } from 'react';
import LoginForm from '../loginORSign/LoginForm';
import SignInForm from '../loginORSign/SignInForm';
import About from '../About Property Insurance/About'
import ramanaSoft from '../Images/ramanaSoft.jpg'

function Home() {
  const [isSignIn, setIsSignIn] = useState(true);

  const toggleView = () => {
    setIsSignIn((prev) => !prev);
  };

  
  return (
    <>
    <div className='background'>
    <div className='top '>
    <img src={ramanaSoft} alt="Ramana Soft Insurance" className="ramanaSoftImage" />
      <h2>Ramana Insurance Policies</h2>
      <button className='forbtn btn btn-inline-primary '>Admin</button>
      
    </div>
    <div >
      <ListOfPolicies/>
      <div className="container">
      <div className="box loginForm">
        <h2>{isSignIn ? 'Sign In' : 'Login'}</h2>
        {isSignIn ? <SignInForm /> : <LoginForm />}
        <p onClick={toggleView} className="toggle-link">
          {isSignIn ? 'Switch to Login' : 'Switch to Sign In'}
        </p>
      </div>
    </div>
    </div>
    </div>
    <About/>
    </>
  )
}

export default Home
